INSERT INTO `handy-ladestation` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Handy-Ladestation/Alltripal Ladestation für mehrere Geräte.webp;', 'Alltripal Ladestation für mehrere Geräte', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo2OTU3MzU5ODM5MTAzNzg3OjE2Njc2NDI2MjU6c3BfYXRmOjIwMDQ0NDYyMTQ5MDk4OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FLadestation-Dockingstation-Lieferumfang-enthalten-Elektronik-Wei%25C3%259F%2Fdp%2FB0832V1BBR%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3DX3W8VQDBP86R%26keywords%3DAlltripal%2BLadestation%2Bf%25C3%25BCr%2Bmehrere%2BGer%25C3%25A4te%26qid%3D1667642625%26qu%3DeyJxc2MiOiIyLjMxIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3Dalltripal%2Bladestation%2Bf%25C3%25BCr%2Bmehrere%2Bger%25C3%25A4te%252Caps%252C166%26sr%3D8-1-spons%26psc%3D1', '45,99', 4.3, 631, 3, 'white;SOOPII;Tablets, Handys, Smartwatches;Samsung Galaxy S10;Usb-c;6;20 Watt;KABEL ENTHALTEN - 8 gemischte Ladekabel: 2 Kabel für lPhone lPad, 2 Stk. Micro-USB-Kabel, 2 Stk. USB-C-Kabel, 1 Stk. USB-C-zu-USB-C-Kabel und 1 Stk. Kabel für das neue lPhone 13/12. Perfekt kompatibel mit all Ihren lPhones und Android-Telefone / -Tablets und andere Elektronik.|VERBESSERTER HALTER - Mit dem neuen Halter für I Watch Charger &amp; Pods werden alle Ihre Telefone, I Watch und Pods an einem Ort aufgeladen, sauber und organisiert. Perfekt geeignet für Unternehmen, Büro, Sitzungssaal, Zuhause, Wohnzimmer, Schlafzimmer, Küche, Hotel, Restaurants und Klassenzimmer. (Das i Watch-Ladegerät ist nicht im Lieferumfang enthalten)|2 PD 20 W SCHNELLES LADEN - Die 2 USB-C-Anschlüsse können 20 W Leistung an jeden Anschluss abgeben, wodurch Ihr neues iPhone 13/12 bis zu 3x schneller aufgeladen wird als das ursprüngliche 5-W-Ladegerät.|Intelligente LED-Anzeige und leises Aufladen – erkennen Sie den Ladestatus durch ein weiches und sanftes Leuchten des entsprechenden Anschlusses. Es hört auf zu leuchten, sobald die geladenen Geräte 100 % erreichen, und es kann jederzeit durch einen Anzeigeschalter an der Seite ausgeschaltet werden. Kein Rauschen, kein Blinken beim Laden.|Für Sie alles durchdacht, was Sie in der Box erhalten: 1- SooPii PD-Ladestation, 7 starke Schallwände für Telefone und Tablets, 1 Schallwandhalterung für I Watch-Ladegerät und Pods (I Watch-Ladegerät ist nicht im Lieferumfang enthalten) und 8er-Pack kurze gemischte Ladekabel für den täglichen Gebrauch, Bedienungsanleitung, unsere sorgenfreie 24-monatige Garantie und freundlicher Kundenservice.');
