e 20 / Note 10 / Note 9 / Note 8 / Note 7</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">iPhone 14 / 14 Pro / 14 Pro Max / iPhone 13 / 13 Mini / 13 Pro / 13 Pro Max / iPho…</span></span>;USB;1;7.5 Watt;DOPPELTE POWER: Gönn dir blitzschnelles, kabelloses Laden mit einem Ladegerät für Zuhause und einem Ladegerät fürs Büro!|IMMER IM BLICK: Vertikal oder horizontal laden. Ideal für Videos, Nachrichten, E-Mails und in Kombination mit Face ID.|NEED FOR SPEED: Das hochmoderne Chipset garantiert 10W Ladungen für Galaxy und 7,5W Ladungen für iPhones - 10% schneller als vergleichbare Ladegeräte. Für beste Ergebnisse ein Quick Charge 2.0 oder 3.0 (9V/2A) Netzteil verwenden.|HÜLLENFREUNDLICH: PowerWave lädt mühelos durch Schutzhüllen von bis zu 5mm Dicke. Metallzubehör und Kreditkarten können den Ladevorgang einschränken.|WAS DU BEKOMMST: 2 PowerWave Ladeständer, 2 Mikro-USB-Kabel (120cm), eine Bedienungsanleitung, 18 Monate Garantie sowie immer freundlichen Kundenservice. (Netzteil nicht im Lieferumfang enthalten.)');
INSERT INTO `handy-ladestation` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Handy-Ladestation/Ladestation Mehrere Geräte Bambus YOJA.webp;', 'Ladestation Mehrere Geräte Bambus YOJA', 'https://www.amazon.de/Ladestation-Mehrere-YOJA-Kopfh%C3%B6rer-Ladeger%C3%A4t-2-1-bambus-mit-1-Micro-USB-C-3-Kabel-f%C3%BCr-iPhone-iPad/dp/B0832LHM33/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3NBRBY9W3WTC6&keywords=Ladestation+Mehrere+Ger%C3%A4te+Bambus+YOJA&qid=1667642642&qu=eyJxc2MiOiItMC4wMSIsInFzYSI6IjAuMDAiLCJxc3AiOiIwLjAwIn0%3D&sprefix=ladestatio%2Caps%2C126&sr=8-3', '46,99', 4.4, 194, 0, '-;-;-;-;-;-;-;Bamboo Ladestation für mehrere Geräte: Mit 5 USB-Ladeanschlüssen und einem Uhrenständer und einem Kopfhörer-Ständer können Sie mehrere Geräte gleichzeitig aufladen, darunter Phone, Tablets, watch, Powerbank usw., ideal zum Organisieren aller Geräte Ihre Geräte und Kabel.|Durchdachte Bambus-Ladestation: Diese 5-in-1-USB-Ladestation besteht aus natürlichem und umweltfreundlichem Bambus, der filigran und klassisch aussieht und eine gute Wärmeabgabeleistung bietet.|5 kurze USB-Kabel enthalten: Die Ladestation wird mit 5 Minikabeln geliefert, um Ihre Anforderungen zu maximieren. Die Länge der kurzen Kabel beträgt 30 cm, sehr leicht zu tragen und keine Kabelsalat mehr. Bitte beachten Sie, dass das Uhrenladegerät nicht im Lieferumfang enthalten ist.|Schnelles und intelligentes Laden: Jeder USB-Port hat einen Smart-Ausgang von 0-2,4 A, sein integrierter Smart-Chip kann die angeschlossenen Produkte identifizieren und ihnen die notwendige Energie zum Laden geben.|Absolute Sicherheit und Schutz: CE-, UL-zertifiziertes Produkt. Mehrere integrierte Schutzvorrichtungen gegen Überlastung, Überhitzung und Überstrom. Diese ladestation erkennt, wann Ihr Gerät voll aufgeladen ist und unterbricht die Stromversorgung, sobald das Gerät voll aufgeladen ist.');
