d3; Note 20,10,10e,10+,9,8|【3-in-1 Faltbarer Schnell ladegerät mit QC 18W Adapter】 Induktive ladestation. Über diese 3 in 1 Ladestation können Laden Sie mehrere Geräte gleichzeitig an einem Ort, ordentlich und organisiert. Laden Sie Ihr iPhone / Apple Watch / Airpods gleichzeitig auf, auch als Halterung für Handy. Auch kompatibel mit Samsung / Huawei-Handys. Der Ladeständer wird mit dem mitgelieferten 18W-QC-3.0-Adapter betrieben. Das kabellose Ladegerät Ihr Telefon ca. 3 Stunden lang vollständig aufladen.|【Magnetischer &amp; Faltbarer &amp; Einstellbarer Winkel】 Kann in eine sehr kleine Größe gefaltet werden, Sie können auch den Sichtwinkel des Telefons anpassen, sodass Sie Videos usw. ansehen können. Diese 3-in-1 Kabellose Ladestation kann Ihr Mobiltelefon / Ihre Uhr / Ihren Kopfhörer gleichzeitig aufladen. Ob zu Hause, auf der Arbeit oder auf Reisen, Sie müssen nur dieses Mehrzweck Kabellose Ladestation mitbringen. Es kann auch als Handyhalter verwendet werden, um Ihre Hände zu befreien.|【SICHERES LADEGERÄT】 Die induktive Ladestation verwendet die fortschrittlichste automatische Steuerungstechnologie. Das Telefon Ladegerät schaltet sich automatisch aus, wenn das Telefon vollständig aufgeladen ist. Schützt den Akku Ihres Geräts vor Überladungsschäden. Dieses Schnellladegerät mit Überstromschutz, Überspannungsschutz und Überladeschutz sorgt für Ihre Ladesicherheit. Der mitgelieferte 15W QC 3.0-Schnell Adapter kann die Ladegeschwindigkeit beschleunigen.|【Bestes Nachttisch-Ladestation】 Dem Sie bequem auf einen Blick Uhrzeit, Datum und Wecker anzeigen können. Der kabelloses ladestation erspart das Auffinden der unschönen Kabel oder des Ladegeräts. Keine unordentlichen Drähte mehr. Bester Nachttisch-Begleiter mit geräuschlosen und automatisch schaltenden Lichtfunktionen. Sie erhalten:1 x 3-in-1 Kabellose Ladestation,1 x 15W Adapter(QC3.0 ),1 x USB-Kabel,1 x Bedienungsanleitung. Dies ist das praktischste Geschenk für Ihre Freunde oder Ihre Familie.');
INSERT INTO `handy-ladestation` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Handy-Ladestation/the SOOPII 6-Port USB-Ladestation.webp;', 'the SOOPII 6-Port USB-Ladestation', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MToxMjc5OTc1NzE1MzMzODQ6MTY2NzY0MjY1ODpzcF9hdGY6MjAwNDQ0NjIxNDkwOTg6OjA6Og&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FLadestation-Dockingstation-Lieferumfang-enthalten-Elektronik-Wei%25C3%259F%2Fdp%2FB0832V1BBR%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D1B3L3NJF15LYY%26keywords%3Dthe%2BSOOPII%2B6-Port%2BUSB-Ladestation%26qid%3D1667642658%26qu%3DeyJxc2MiOiIxLjAzIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3Dthe%2Bsoopii%2B6-por%252Caps%252C85%26sr%3D8-1-spons%26psc%3D1', '45,99', 4.3, 631, 0, 'white;SOOPII;Tablets, Handys, Smartwatches;Samsung Galaxy S10;Usb-c;6;20 Watt;KABEL ENTHALTEN - 8 gemischte Ladekabel: 2 Kabel für lPhone lPad, 2 Stk. Micro-USB-Kabel, 2 Stk. USB-C-Kabel, 1 Stk. USB-C-zu-USB-C-Kabel und 1 Stk. Kabel für das neue lPhone 13/12. Perfekt kompatibel mit all Ihren lPhones und Android-Telefone / -Tablets und andere Elektronik.|VERBESSERTER HALTER - Mit dem neuen Halter für I Watch Charger &amp; Pods werden alle Ihre Telefone, I Watch und Pods an einem Ort aufgeladen, sauber und organisiert. Perfekt geeignet für Unternehmen, Büro, Sitzungssaal, Zuhause, Wohnzimmer, Schlafzimmer, Küche, Hotel, Restaurants und Klassenzimmer. (Das i Watch-Ladegerät ist nicht im Lieferumfang enthalten)|2 PD 20 W SCHNELLES LADEN - Die 2 USB-C-Anschlüsse können 20 W Leistung an jeden Anschluss abgeben, wodurch Ihr neues iPhone 13/12 bis zu 3x schneller aufgeladen wird als das ursprüngliche 5-W-Ladegerät.|Intelligente LED-Anzeige und leises Aufladen – erkennen Sie den Ladestatus durch ein weiches und sanftes Leuchten des entsprechenden Anschlusses. Es hört auf zu leuchten, sobald die geladenen Geräte 100 % erreichen, und es kann jederzeit durch einen Anzeigeschalter an der Seite ausgeschaltet werden. Kein Rauschen, kein Blinken beim Laden.|Für Sie alles durchdacht, was Sie in der Box erhalten: 1- SooPii PD-Ladestation, 7 starke Schallwände für Telefone und Tablets, 1 Schallwandhalterung für I Watch-Ladegerät und Pods (I Watch-Ladegerät ist nicht im Lieferumfang enthalten) und 8er-Pack kurze gemischte Ladekabel für den täglichen Gebrauch, Bedienungsanleitung, unsere sorgenfreie 24-monatige Garantie und freundlicher Kundenservice.');
INSERT INTO `handy-ladestation` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Handy-Ladestation/TechDot Handy USB Ladestation .webp;', 'TechDot Handy USB Ladestation ', 'https://www.amazon.de/TechDot-Ladestation-Mehrere-Smartphones-Tablets-1-1-Schwarz-mit-2-Apple-Micro-usb-C-Kabel/dp/B07MQSLF9D/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=ET9E6E4GG844&keywords=TechDot+Handy+USB+Ladestation&qid=1667642669&qu=eyJxc2MiOiIyLjc1IiwicXNhIjoiMi43OSIsInFzcCI6IjIuODcifQ%3D%3D&sprefix=techdot+handy+%2Caps%2C85&sr=8-3', '36,99', 4.5, 565, 0, 'black;TechDot;Tablets, Lautsprecher, Handys;-;USB;6;50 Watt;Sauber und organisiert - Keine lästigen Kabel mehr. Es ist nicht mehr nötig, für jedes Telefon und Tablet, das Sie besitzen, mehrere Ladegeräte an die Steckdose anzuschließen. Diese kompakte Ladestation für mehrere Geräte hält alles an einem Ort - schön, sauber und organisiert. Es kommt mit 6 kurzen kabel.|Aktualisierte Version Ladestation mit Schalter - Dieser Schalter steuert die Stromversorgung von 6 USB-Anschlüssen (nicht wie bei einer anderen Ladestation mit einem Schalter, der nur die Teilerleuchte steuert). Wenn Ihre Geräte vollständig geladen sind, können Sie die Taste einfach drücken, um Energie zu sparen und die Batterie Ihrer Geräte zu schützen.|ARBEITET MIT JEDEM GERÄT - Diese USB Ladestation hat 6 Steckplätze und 6 USB-Anschlüsse, die bis zu 6 Geräte gleichzeitig halten und laden können. Diese Ladestation funktioniert problemlos mit jedem USB-Gerät wie Handy Tablets und Android-Smartphones, Tablets, Kameras, E-Reader, Bluetooth-Headsets, Lautsprechern und vielem mehr.|Schnelles und intelligentes Laden - Diese mehrfache USB Ladestation verfügt über 6 leistungsstarke 2,4-A-Schnellladeanschlüsse für Geräte mit großer Akkukapazität, wie Tablets und große Smartphones. Der USB-Hub kann von allen 6 Ports insgesamt bis zu 8 A liefern. Jeder Port dieser Mehrfachladestation erkennt die genauen Spannungsanforderungen eines angeschlossenen Gerätes und passt die Ausgangsleistung für ein sicheres und schnelles Laden an.|SICHERHEIT UND SCHUTZ - Diese 6-Port-USB-Ladestation ist auf der Oberfläche mit gebürstetem Aluminiumblech abgedeckt und bietet eine gute thermische Dispersionsleistung. Das Gerät ist außerdem gegen Kurzschluss, Überspannung, Überstrom und Überladung geschützt.');
